    flex-direction: column;
    gap: 1rem;
    padding: 0.5rem 1rem 0.5rem 1rem;
  }
`;
const NavbarBrand = styled.div`
  font-family: ${pixelFont};
  font-size: 2.1rem;
  color: ${accent};
  font-weight: 900;
  text-shadow: 2px 2px 0 ${richBrown}, 0 0 8px ${accent};
  letter-spacing: 3px;
  cursor: pointer;
  text-transform: uppercase;
  margin-bottom: 0;
  image-rendering: pixelated;
  @media (max-width: 700px) {
    font-size: 1.3rem;
  }
`;

const NavbarLinks = styled.div`
  display: flex;
  flex-direction: row;
  gap: 2.1rem;
  align-items: center;
  @media (max-width: 700px) {
    flex-direction: column; 
    gap: 1rem; 
  }
`;
const NavbarLink = styled.a`
  color: ${accent};
  font-size: 0.9rem;
  text-decoration: none;
  padding: 0.62rem 2.1rem;
  border-radius: 9px;
  background: ${richBrown};
  border: 3px solid ${accent};
  display: flex;
  align-items: center;
  gap: 0.5rem;
  transition: background 0.2s, color 0.2s, box-shadow 0.2s;
  font-family: ${pixelFont};
  letter-spacing: 0.04em;
  image-rendering: pixelated;
  box-shadow: 3px 3px 0 ${secondary};
  &:hover {
    background: ${accent};
    color: ${richBrown};
    box-shadow: 6px 6px 0 ${primary};
  }
  @media (max-width: 700px) {
    font-size: 1rem; /* Увеличено с 0.9rem для читаемости */
    padding: 0.8rem 1.5rem; /* Увеличено для сенсорных зон */
    width: 100%; /* Полная ширина для удобства нажатия */
    justify-content: center; /* Центрирование содержимого */
  }
`;

const AppContainer = styled.div`
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: flex-start;
  color: ${textMain};
  padding: 0.2rem 1.5rem 2rem 1.5rem;
  position: relative;
  font-family: ${pixelFont};
  background: transparent;
  gap: 2.5rem;
  z-index: 1;
  image-rendering: pixelated;
  @media (max-width: 900px) {
    gap: 1.5rem;
    padding: 1.5rem; /* Увеличено с 1.2rem 0.4rem */
  }
  @media (max-width: 700px) {
    gap: 1rem; /* Увеличено с 0.7rem */
    padding: 1rem; /* Увеличено с 0.6rem 0.2rem для отступов */
  }
`;

const MascotBottom = styled.img`
  display: block;
  margin: 2rem auto 0 auto;
  width: 210px;
  height: auto;
  image-rendering: pixelated;
  filter: drop-shadow(0 8px 32px #c97d3d44);
  @media (max-width: 700px) {
    width: 120px;
    margin-top: 1.2rem;
  }
`;

const BottomSection = styled.section`
  width: 100vw;
  background: ${cardBg};
  border-top: 2px solid ${cardBorder};
  box-shadow: 0 -4px 18px 0 ${cardBorder}22;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: flex-start;
  padding: 2.2rem 0 1.4rem 0;
  margin-top: 2.2rem;
  border-radius: 0;
  min-height: 220px;
  position: relative;
  z-index: 11;
  @media (max-width: 700px) {
    padding: 1.1rem 0 0.7rem 0;
    min-height: 130px;
  }
`;

const BottomMascot = styled.img`
  width: 120px;
  height: 120px;
  border-radius: 0.7rem;
  object-fit: contain;
  object-position: center;
  margin-bottom: 0.7rem;
  box-shadow: 0 4px 16px ${cardBorder}33;
  background: ${cardBg};
  border: 2px solid ${cardBorder};
  image-rendering: pixelated;
  @media (max-width: 700px) {
    width: 72px;
    height: 72px;
    border-width: 2px;
  }
`;

const BottomTokenName = styled.h2`
  font-family: ${pixelFont};
  font-size: 1.3rem;
  color: ${cardBorder};
  margin-bottom: 0.6rem;
  text-align: center;
  letter-spacing: 2px;
  text-shadow: 2px 2px 0 ${cardBg}, 0 0 10px ${cardBorder}22;
  @media (max-width: 700px) {
    font-size: 0.8rem;
    margin-bottom: 0.3rem;
  }
`;

const BottomBuyButton = styled.a`
  display: flex;
  align-items: center;
  justify-content: center;
  background: ${cardBg};
  color: ${cardBorder};
  font-family: ${pixelFont};
  font-size: 1rem;
  font-weight: 900;
  border: 2px solid ${cardBorder};
  border-radius: 0.7rem;
  padding: 0.7rem 2rem;
  margin-bottom: 0.7rem;
  margin-top: 0.3rem;
  box-shadow: 0 2px 7px ${cardBorder}22;
  text-decoration: none;
  transition: background 0.2s, color 0.2s, box-shadow 0.2s, border 0.2s;
  cursor: pointer;
  &:hover {
    background: ${cardBorder};
    color: ${cardBg};
    border: 2px solid ${accent};
    box-shadow: 0 4px 16px ${accent}33;
  }
  @media (max-width: 700px) {
    font-size: 0.8rem;
    padding: 0.4rem 1rem;
  }
`;

const BottomSubtext = styled.div`
  color: ${cardBorder};
  font-family: ${pixelFont};
  font-size: 0.77rem;
  margin-top: 0.4rem;
  opacity: 0.7;
  text-align: center;
  @media (max-width: 700px) {
    font-size: 0.65rem;
  }
`;

function App() {
  return (
    <>
      <AnimatedBg />
      <Navbar>
        <NavbarBrand>JIGGIT</NavbarBrand>
        <NavbarLinks>
          <NavbarLink href="https://t.me/jiggit" target="_blank" rel="noopener noreferrer"><FaTelegram />Telegram</NavbarLink>
          <NavbarLink href="https://twitter.com/jiggit" target="_blank" rel="noopener noreferrer"><FaXTwitter />Twitter</NavbarLink>
          <NavbarLink href="https://medium.com/@zerobladeamir" target="_blank" rel="noopener noreferrer"><FaMedium />Medium</NavbarLink>
        </NavbarLinks>
      </Navbar>
      <AppContainer>
        <HeroSection />
        <Roadmap />
      </AppContainer>
      <BottomSection>
        <BottomMascot src="/assets/mascot_bottom.png" alt="Jiggit Mascot" />
        <BottomTokenName>$JIGGIT</BottomTokenName>
        <BottomBuyButton href="#buy" target="_blank" rel="noopener noreferrer">
          Buy $Jiggit
        </BottomBuyButton>
        <BottomSubtext>→ Powered by Jiggit token team</BottomSubtext>
      </BottomSection>
    </>
  );
}

export default App;
